//import logo from './logo.svg';
import React from 'react';
import './App.css';
import Header from './components/Header';
import RepositoryList from './components/RepositoryList';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <RepositoryList />
      <Footer />
    </div>
  );
}

export default App;
